import {Fragment} from 'react'
import MealsSummary from './MealsSummary';
import MealsAvailable from './MealAvailable';
const Meals = () => {
    return (
        <Fragment>
           <MealsSummary/>
           <MealsAvailable/>
        </Fragment>
    )
}

export default Meals
